import React from 'react'
import PropTypes from 'prop-types'

function Header() {
  return (
        <div className='containerBotonesID'>
        </div>
  )
}

Header.defaultProps ={
    text: 'Este es el texto por defecto si no recibo argumentos'
}
Header.propTypes = {
    text: PropTypes.string
}

export default Header
